import React from 'react';
import { useNavigate } from 'react-router-dom';

function Dashboard() {
    const navigate = useNavigate();

    const styles = {
        container: {
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            padding: '20px',
            backgroundColor: '#f9f9f9',
            minHeight: '100vh',
            boxSizing: 'border-box',
        },
        header: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center',
            width: '100%',
            padding: '10px 20px',
            backgroundColor: '#ffffff',
            boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)',
            marginBottom: '20px',
        },
        logo: {
            fontSize: '24px',
            fontWeight: 'bold',
            color: '#333',
        },
        profileLink: {
            textDecoration: 'none',
            color: '#333',
            fontSize: '18px',
        },
        searchIcon: {
            fontSize: '24px',
            cursor: 'pointer',
        },
    };

    const handleProfileClick = () => {
        navigate('/profile');
    };

    const handleSearchClick = () => {
        console.log('Search clicked');
    };

    return (
        <div style={styles.container}>
            <div style={styles.header}>
                <a href="/profile" style={styles.profileLink} onClick={handleProfileClick}>Profile</a>
                <div style={styles.logo}>LOGO</div>
                <div style={styles.searchIcon} onClick={handleSearchClick}>
                    üîç
                </div>
            </div>
            <div>
                {/* ‰∏≠Èó¥ÂÜÖÂÆπÂå∫Âüü */}
                <h1>Dashboard Content</h1>
                {/* ÂèØ‰ª•Âú®ËøôÈáåÊ∑ªÂä†‰Ω†ÈúÄË¶ÅÁöÑÁªÑ‰ª∂ÊàñÂÖ∂‰ªñÂÜÖÂÆπ */}
            </div>
        </div>
    );
}

export default Dashboard;
